import React from "react";

const MainImage = ({ topImage }) => {
  return (
    <div>
      {topImage.original_title}
      <img
        src={"https://image.tmdb.org/t/p/w120/" + topImage.poster_path}
        alt=""
      />
    </div>
  );
};

export default MainImage;
